  false,\n\t\"url\": null,\n\t\"notes\": \"The USGS has produced a comprehensive database
  of digital vector shorelines by compiling shoreline positions from pre-existing
  historical shoreline databases and by generating historical and modern shoreline
  data. Shorelines are compiled by state and generally correspond to one of four time
  periods: 1800s, 1920s-1930s, 1970s, and 1998-2002. These shorelines were used to
  calculate long-term and short-term change rates in a GIS using the Digital Shoreline
  Analysis System (DSAS) version 3.0; An ArcGIS extension for calculating shoreline
  change: U.S. Geological Survey Open-File Report 2005-1304, Thieler, E.R., Himmelstoss,
  E.A., Zichichi, J.L., and Miller, T.M. Shoreline vectors derived from historic sources
  (first three time periods) represent the high water line (HWL) at the time of the
  survey, whereas modern shorelines (final time period) represent the mean high water
  line (MHW). Changing the shoreline definition from a proxy-based physical feature
  that is uncontrolled in terms of an elevation datum (HWL) to a datum-based shoreline
  defined by an elevation contour (MHW) has important implications with regard to
  inferred changes in shoreline position and calculated rates of change. This proxy-datum
  offset is particularly important when averaging shoreline change rates alongshore.
  Since the proxy-datum offset is a bias, virtually always acting in the same direction,
  the error associated with the apparent shoreline change rate shift does not cancel
  during averaging and it is important to quantify the bias in order to account for
  the rate shift. The shoreline change rates presented in this report have been calculated
  by accounting for the proxy-datum bias.\",\n\t\"owner_org\": \"bd2cdd5a-4d65-46c0-9937-c8381175f104\",\n\t\"extras\":
